AutoConfiguration 설정과 원리RedisAutoConfiguration로 이해하는 AutoConfiguration@Configuration(proxyBeanMethods = false)
@ConditionalOnClass(RedisOperations.class)
@EnableConfigurationProperties(RedisProperties.class)
@Import({ LettuceConnectionConfiguration.class, JedisConnectionConfiguration.class })
public class RedisAutoConfiguration {

    @Bean
    @ConditionalOnMissingBean(name = "redisTemplate")
    public RedisTemplate redisTemplate(RedisConnectionFactory redisConnectionFactory)
            throws UnknownHostException {
        RedisTemplate template = new RedisTemplate<>();
        template.setConnectionFactory(redisConnectionFactory);
        return template;
    }

    @Bean
    @ConditionalOnMissingBean
    public StringRedisTemplate stringRedisTemplate(RedisConnectionFactory redisConnectionFactory)
            throws UnknownHostException {
        StringRedisTemplate template = new StringRedisTemplate();
        template.setConnectionFactory(redisConnectionFactory);
        return template;
    }

}
@ConditionalOnMissingBean특정 빈이 사전에 생성되지 않는 경우 조건이 만족됨.@Bean과 함께 사용된다면 이미 생성된 빈이 없을 때 해당 빈을 생성한다는 의미로 보면 된다.-> @ConditionalOnMissingBean+@Bean 의 조합일때사용자가 특정 빈을 생성하도록 설정해놨다면, 일반적으로 AutoConfiguration의 생성 순서가 마지막에 오도록 AutoConfiguration이 잘 짜여있기 때문에 우리가 설정한 bean이 먼저 생성되고 해당 AutoConfiguration은 필터링 되어 중복생성되는 상황을 막는다.반대고 사용자가 해당 빈을 설정하지 않았다면 AutoConfiguration에서는 해당 빈을 자동생성하게 된다.@ConditionalOnClassclassPath에 특정 클래스가 존재할 때만 조건이 만족된다.작업을 위해 필수적으로 필요한 의존성이 등록되어 있는지 체크할 때 사용할 수 있다.RedisAutoConfiguration 클래스의 경우 RedisOperations 파일이 classPath에 존재할 때 조건이 만족하여 RedisAutoConfiguration이 동작하게 된다@ConditionalOnBeanRedisAutoConfiguration에는 해당 어노테이션이 사용되지 않았지만 정리해봄.특정 빈이 이미 생성되어 있는 경우에만 조건이 만족한다. 작업을 위해 필수적으로 필요한 빈이 미리 생성되어 있는지 체크할 때 사용할 수 있다.예를들어 JdbcTemplate를 생성하기 위해 DataSource가 필요하다.@Bean 
@ConditionalOnBean(name={"dataSource"}) 
public JdbcTemplate jdbcTemplate(DataSource dataSource) {
  returnnew JdbcTemplate(dataSource); 
}
dataSource라고 정의된 빈이 존재할 때만 JdbcTemplate 빈을 생성한다. 만약에 dataSource가 존재하지 않는다면 JdbcTemplate을 만들 수도 없을 뿐더러 만들 필요가 없기 때문에 AutoConfiguration과정에서 JdbcTemplate을 빈으로 생성하지 않는다.@EnableConfigurationPropertiesRedisProperties를 이용해서 관련 프로퍼티 정보를 읽어온다.@Configuration(proxyBeanMethods = false)lite mode 적용 여부 (false: lite mode 적용,cglib 사용하지 않는 상태에서 설정이 진행됨)

